INSERT INTO `berita` (`id_berita`, `judul`, `isi`, `date`, `label`, `lihat`, `author`, `time`, `thumbnail`) VALUES
(1, 'PMR SMKN 1 Sumedang Juara Umum Lomba Antariksa sejawabarat', 'PMR SMKN 1 sumedang menjadi Juara Umum Lomba Antariksa PMR Se - Jawa Barat  yang di selenggarakan di yang diselenggarakan di SMAN 24 Bandung.', 'Selasa, 11 Oktober 2016', '', 0, 'Admin', '09:50:14', '/assets/img/b_pmr.jpg'),
(2, 'Lowongan Pekerjaan PT. Trans Retail Indonesia', '(TRANSMART-CARREFOUR) \r\n1. Deputy Dept. Store(kode : DEPUTY) min 5 tahun di Dept.Store\r\n2. Divisi Dept. Store (kode : DIVISI) min 4 tahun di Dept. Store\r\n3. Sales Manager Dept. Store ( Shoes, Handbag & Accecoris ). ( kode : SHOES) min 3 tahun di Dept. Store\r\n4. Sales Manager Dept. Store ( Man, Ladies & Children ) ( kode : MAN ) min 3 tahun di Dept. Store\r\n5. Sales Manager Dept. Store ( C & F ) ( kode : COSMETIC) min 3 tahun di Dept. Store\r\n6. Team Leader Dept. Store ( Shoes, Handbag & Accecoris ). (Kode: TLSHOES) min 2 tahun di Dept. Store\r\n7. Team Leader Dept. Store ( Man, Ladies & Children ) ( kode: TLMAN) min 2 tahun.di Dept. Store\r\n8. Team Leader Dept. Store ( C & F ) ( Kode : TLCOSMETIC) min 2 tahun di Dept. Store\r\n9. Sales Associate Dept. Store ( Shoes, Handbag & Accecoris ) (kode: SASHOES) min 1 tahun di Dept. Store\r\n10. Sales Associate Dept. Store ( Man, Ladies & Children ) ( kode : SAMAN) min 1 tahun di. Dept. Store\r\n11. Sales Associate Dept. Store ( C & F ) ( kode: SACOSMETIC) min 1 tahun di Dept. Store\r\n12. Chef pengalaman di Restaurant/Hotel 3-5 tahun (Kode:CHEF)\r\n13. Baker pengalaman di Restarant/Hotel 3-5 tahun (kode:BAKER)\r\n14. Barista pengalaman di Restaurant/Hotel 3-5 tahun (kode: BARISTA)\r\n\r\nPenempatan pada Gerai\r\n\r\n1. Surabaya\r\n2. Bandung\r\n3. Padang\r\n4. Depok\r\n5. Yogyakarta\r\n6. Manado \r\n7. Tegal\r\n8. Mataram \r\n9. Pekan Baru\r\n10. Semarang\r\n11. Jakarta\r\n12. Palembang\r\n13. Karawang\r\n\r\nPersyaratan umum\r\n\r\nNo. 1 sd 5\r\n- Pria/Wanita, max 30 tahun\r\n- Minimum S1 segala jurusan\r\n- Jujur, Tegas, Teliti dan Bertanggung jawab\r\n- Dapat bekerja sama dalam tim\r\n- berpengalaman di dept. store \r\n- diutamakan dept. store dari :\r\nSogo, Metro, Lotus, Centro, Matahari, Ramayana, Ria Busana dan Sejenisnya\r\n\r\nNo. 6 sd 11\r\n- Pria/Wanita, max 25 tahun\r\n- Minimum SLTA segala jurusan\r\n- Jujur, Tegas, Teliti dan Bertanggung jawab\r\n- Dapat bekerja sama dalam tim\r\n- berpengalaman di dept. store min 1 tahun\r\n- diutamakan dept. store dari :\r\nSogo, Metro, Lotus, Centro, Matahari, Ramayana, Ria Busana dan Sejenisnya\r\n\r\nNo. 12 sd 14\r\n- Pria / Wanita, Max 35 tahun\r\n- Minimum S1 Perhotelan / Pariwisata / Tataboga\r\n- Jujur, Tegas, teliti & bertanggung jawab\r\n- Dapat bekerja sama dalam tim\r\n- berpengalaman di Hotel / Restaurant 3-5 tahun\r\n\r\nBagi yg berminat & memenuhi syarat & kualifikasi, silahkan kirimkan CV dan Surat Lamaran beserta Lampiran Ijazah terakhir & surat pengalaman kerja sesuai persyaratan diatas ke alamat email kami :\r\nSUMARNI_SURMARNI@TRANSRETAIL.CO.ID\r\nSumarni_surmarni@transretail.co.id\r\n\r\nDengan mencantumkan KODE yang dipilih pada subject email.\r\nContoh:\r\n1. DEPUTY Karawang exp SOGO 5 tahun\r\n2. TLSHOES Manado exp METRO 2 tahun\r\n3. CHEF Surabaya exp Hotel 4 tahun\r\n\r\nMohon bantuannya untuk share, barangkali ada keluarga atau kerabat yang membutuhkan pekerjaan & memenuhi kualifikasi di atas.\r\nTerima kasih.', 'Senin, 24 Oktober 2016', '', 0, '', '05:26:11', '/assets/img/trans.jpg'),
(3, 'Job Fair 2016', '', 'Kamis, 20 Oktober 2016 ', '', 0, 'Admin', '18:50:54', '/assets/img/job_fair.jpg'),
(4, 'Informasi Prakerin Kelas XI', 'Gelombang I\r\n\r\nPraktek Kerja Lapangan (PKL) gelombang I mulai tanggal 24 oktober 2016 s.d. 23 Januari 2017 untuk paket keahlian Teknik Audio Video (TAV), TIPTL, Teknik Pemesinan (TPM),Teknik Pengelasan (TPL), Teknik Kendaraan Ringan (TKR), Teknik Komputer Jaringan (TKJ), Rekayasa Perangkat Lunak (RPL).\r\n\r\n \r\n\r\nGelombang II\r\n\r\nRencana tanggal 9 Januari 2017 s.d. 8 April 2017 , untuk Paket keahlian : Teknik Gambar Bangunan(TGB), Teknik Otomasi Industri (TOI), Teknik Elektro Industri (TEI), Seni Karawitan (SK).\r\n', 'Selasa, 18 Oktober 2016', '', 0, 'Admin', '11:03:09', '/assets/img/prakerin.jpg'),
(5, 'Persyaratan Seleksi SLTA (Operator) PT. AHM 2016', 'lulusan SMK jurusan Otomotif, teknik sepeda motor, teknik kendaraan ringan, teknik audio video atau elektronika/IPA.\r\nLaki-laki\r\numur 18-20 thn (per 09 November 2016)\r\ntinggi badan min 163 cm\r\ntidak buta warna\r\ntidak berkacamata\r\nnilai rata-rata 6.5 (raport kelas 1-3)\r\nmemiliki SIM C\r\nMembawa Alat Tulis\r\nmemakai Baju Putih dan Celana Hitam\r\n \r\n\r\nDokumen yang harus dilengkapi\r\n\r\nSIM C\r\nCV\r\nLamaran\r\n1.Photo 2 X 3 (2 lembar) background Merah\r\n2.Photocopy Akte kelahiran\r\n3.Photocopy Kartu Keluarga\r\n4.Photocopy KTP( yang masih berlaku)\r\n6.Photocopy Ijazah\r\n7.Photocopy Raport (1-3)\r\n8. SKCK yang berlaku\r\n9. Photocopy NPWP\r\n10. Transkrip Nilai\r\ndaftar ke BKK SMKN1 Sumedang. Paling lambat tgl 24 October 2016. Tes di kuningan\r\n\r\ninformasi Lebih Lengkap Silakan Hub. BKK SMKN 1 Sumedang', 'Selasa, 18 Oktober 2016', '', 0, 'Admin', '16:31:45', '/assets/img/ahm.jpg');
