INSERT INTO `jurusan` (`id`, `kode`, `nama`, `logo`, `visi`, `misi`, `kompetensi`, `fasilitas`, `img`, `struktur`, `icon`) VALUES
(1, 'rpl', 'Rekayasa Perangkat Lunak', '/assets/img/logorpl.png', 'mencetak tenaga profesional di bidang rekayasa perangkat lunak dalam menghadapi MEA ( Masyarakat Ekonomi Asean ) pada tahun 2017', '\r\n1.menyelenggarakan pendidikan paket keahlian rekayasa perangkat lunak untuk menghasilkan lulusan yang kompeten.\r\n\r\n2.menghasilkan tamatan yang memiliki kompetensi tinggi dan terampil dalam bidang paket keahlian rekayasa perangkat lunak serta berwawasan global dan bertaqwa kepada tuhan yang maha esa', '1.Mengoperasikan Peripheral\r\n2.Modul 4 Mengoperasikan perangkat lunak Pengolah Kata\r\n3. mengoperasikan Perangkat Lunak Lembar Sebar\r\n4. Mengoperasikan Perangkat Lunak Presentasi\r\n5. Mengoperasikan Perangkat Lunak Basis Data\r\n6. Melakukan Koneksi Internet dan Bekerja Dengan Int\r\n7. Mengelola Informasi\r\n8. Merakit_Personal_Komputer \r\n9. Melakukan_Instalasi_Sistem_Operasi_Dasar\r\n10. Menerapkan_Keselamatan Kesehatan Kerja dan Lingkungan Hidup\r\n11. Melakukan_instalasi_sistem_operasi_GUI_dan_CLI\r\n12. Melakukan_Instalasi_Software\r\n13. Merancang_web_database_untuk_kontent_server1', '-lab komputer\r\n-perpustakaan\r\n-mesjid\r\n-wifi\r\n-laptop\r\n-simulasi jaringan\r\n-lab komputer2\r\n-server1', '/assets/img/galrpl.jpg', '/assets/img/s_rpl.png', ''),
(2, 'sk', 'Seni Karawitan', '/assets/img/logosk.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Seni Karawitan.', '1. Menyelenggarakan pendidikan kompetensi keahlian Seni Karawitan untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '', '-Ruang Musik\r\n-Peralatan Musik', '', '/assets/img/s_sk.png', ''),
(3, 'tav', 'Teknik Audio Video', '/assets/img/logoelektro.png', 'Menjadi penyelenggara pendidikan profesional yang unggul dalam kompetensi keahlian Teknik Audio Video', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Audio Video untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '1. Perakitan Amplifier\r\n2. Perakitan TV, VCD, DVD\r\n3. Perakitan Monitor Komputer', '1. Laboratorium Elektronika Komunikasi\r\n2. Laboratorium Komputer', '/assets/img/galelektro.jpg', '/assets/img/s_tav.png', ''),
(4, 'tei', 'Teknik Elektro Industri', '/assets/img/logoelektro.png', 'Menjadi penyelenggara pendidikan profesional yang unggul dalam kompetensi keahlian Teknik Elektro Industri', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Elektro Industri untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '', '1. Laboratorium Elektronika Komunikasi\r\n2. Laboratorium Komputer', '/assets/img/galelektro.jpg', '/assets/img/s_tei.png', ''),
(5, 'tgb', 'Teknik Gambar Bangunan', '/assets/img/logotgb.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Gambar Bangunan.', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Gambar Bangunan untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '1. Dapat mendesign sebuah rancang bangunan. baik secara visualisi 2D atau 3D.\r\n2. Dapat Merancang gambar dan arsitektur bangunan dengan menggunakan autocad.\r\n3. Mempunyai produk unggulan dari hasil design rancang bangunanan untuk nantinya di pasarkan.', '-Laboratorium Komputer Auto-Cad Studio Gambar', '/assets/img/galtgb.jpg', '/assets/img/s_tgb.png', ''),
(6, 'tiptl', 'Teknik Instalasi Pemanfaatan Tenaga Listrik.', '/assets/img/logolistrik.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Instalasi pemanfaatan Tenaga Listrik.', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Instalasi pemanfaatan Tenaga Listrik untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.\r\n3. Mengembangkan suasana PBM yang memungkinkan terjadinya produktivitas dan kualitas kerja yang tinggi.', '1. Transformator\r\n2. PLC', '-Laboratorium Komputer Auto-Cad\r\n-Laboratorium Kelistrikan', '/assets/img/gallistrik.jpg', '/assets/img/s_tiptl.png', ''),
(7, 'tkj', 'Teknik Komputer Jaringan', '/assets/img/logorpl.png', 'Mencetak tenaga profesional di bidang Teknik Komputer Jaringan (TKJ) dalam menghadapi MEA ( Masyarakat Ekonomi Asean ) pada tahun 2017', '1. menyelenggarakan pendidikan paket keahlian Teknik Komputer Jaringan untuk menghasilkan lulusan yang kompeten\r\n2. menghasilkan tamatan yang memiliki kompetensi tinggi dan terampil dalam bidang paket keahlian rekayasa perangkat lunak serta berwawasan global dan bertaqwa kepada tuhan yang maha esa', '1. Mengoperasikan Peripheral\r\n2. Modul 4 Mengoperasikan perangkat lunak Pengolah Kata\r\n3. mengoperasikan Perangkat Lunak Lembar Sebar\r\n4. Mengoperasikan Perangkat Lunak Presentasi\r\n5. Mengoperasikan Perangkat Lunak Basis Data\r\n6. Melakukan Koneksi Internet dan Bekerja Dengan Int\r\n7. Mengelola Informasi\r\n8. Merakit_Personal_Komputer\r\n9. Melakukan_Instalasi_Sistem_Operasi_Dasar\r\n10. Menerapkan_Keselamatan Kesehatan Kerja dan Lingkungan Hidup\r\n11. Menerapkan_teknik_elektronika_analog_dan_digital_dasar\r\n12.Menerapkan_fungsi_peripheral_dan_instalasi_PC\r\n13. Mendiagnosis_permasalahan_pengoperasian_PC_dan_periferal\r\n14. Melakukan_perbaikan_dan_atau_setting_ulang_sistem_PC\r\n15. Melakukan_perbaikan_periferal\r\n16. Melakukan_perawatan_PC\r\n17. Melakukan_instalasi_sistem_operasi_GUI_dan_CLI\r\n18. Melakukan_Instalasi_Software\r\n19. Melakukan_Instalasi_Perangkat_Jaringan_LAN\r\n20. Mendiagnosis_Permasalahan_Pengoperasian PC yg tersambung Jaringan\r\n21. Melakukan_Perbaikan_dan_atau_Setting_Ulang_Koneksi_Jaringan\r\n22. Melakukan_Instalasi_Sistem_Operasi_Jaringan_Berbasis_GUI\r\n23. Melakukan_Instalasi_Perangkat_Jaringan_Berbasis_Luas_(WAN)\r\n24. Mendiagnosis_Permasalahan_Perangkat yang tersambung Jaringan (WAN)\r\n25. Melakukan_Perbaikan_danatau_Setting_Ulang_Koneksi Jaringan (WAN)\r\n26. Menginstalasi_Jaringan_Tanpa_Kabel_(Wireless)\r\n27. Instalasi_Sistem_Operasi_Open_Source\r\n28. Menginstalasi_dan_Mengkonfigurasi_Router\r\n29. Membuat_desain_sistem_keamanan_jaringan\r\n30. Mengadministrasi_server_dalam_jaringan\r\n31. Merancang_bangun_dan_menganalisa_WAN\r\n32. Merancang_web_database_untuk_kontent_server1', '-lab komputer\r\n-wifi\r\n-Notebook\r\n-simulasi jaringan\r\n-lab komputer2\r\n-server', '/assets/img/galrpl.jpg', '/assets/img/s_tkj.png', ''),
(8, 'tkr', 'Teknik Kendaraan Ringan', '/assets/img/logotkr.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Kendaraan Ringan', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Kendaraan Ringan untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '1. Cat dan Body kendaraan\r\n2. Emisi kendaraan\r\n3. Tune Up Kendaraan', '-Lab. Motor(Engine)Mobil\r\n-Bengkel Praktek', '/assets/img/galtkr.jpg', '/assets/img/s_tkr.png', ''),
(9, 'toi', 'Teknik Otomasi Industri', '/assets/img/logolistrik.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Otomasi Industri.', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Otomasi Industri untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.\r\n3. Mengembangkan suasana PBM yang memungkinkan terjadinya produktivitas dan kualitas kerja yang tinggi.', '1. Transformator\r\n2. PLC', '-Laboratorium Komputer Auto-Cad\r\n-Laboratorium Kelistrikan', '/assets/img/gallistrik.jpg', '/assets/img/s_toi.png', ''),
(10, 'tpl', 'Teknik Pengelasan', '/assets/img/logomesin.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Pengelasan.', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Pengelasanuntuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '1. Program CNC\r\n2. Autocad mesin', '-Laboratorium Komputer Auto-Cad\r\n-Bengkel Praktek', '/assets/img/galmesin.jpg', '/assets/img/s_tpl.png', ''),
(11, 'tpm', 'Teknik Pemesinan', '/assets/img/logomesin.png', 'Menjadi kompetensi keahlian yang unggul dan terdepan dalam pendidikan vokasi kompetensi keahlian Teknik Pemesinan.', '1. Menyelenggarakan pendidikan kompetensi keahlian Teknik Pemesinan untuk menghasilkan lulusan yang kompeten.\r\n2. Lulusan memiliki semangat terus berkembang, bermoral tinggi dan berjiwa kewirausahaan.', '1. Program CNC\r\n2. Autocad mesin', '-Laboratorium Komputer Auto-Cad\r\n-Bengkel Praktek', '/assets/img/galmesin.jpg', '/assets/img/s_tpm.png', '');
